// Login Page

import Footer from '../Footer/Footer'
import Header from '../Header/Header'

function Login() {

  return (
    <>
    <Header/>
    <form className="login-form" action="" method="get">
      <h1 className="">Login</h1>

    </form>
    <Footer/>
    </>
  )
}

export default Login
